import React from 'react';
import './HomePage.css'; // Import your central CSS file

function HomePage() {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <div className="text-center">
        <h1 className="text-4xl font-semibold text-blue-900 mb-4">
          Multiple Perspectives
        </h1>
        <p className="text-gray-700 text-xl">by David Park</p>
        <button className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 mt-4 rounded">
          Click Me
        </button>
      </div>
    </div>
  );
}

export default HomePage;
